########################################################################
# Register Assignment:
#	- $s0:	spirite to Load
#	- $s1: 	address of spirite
#	- $s2:	ninja star
#	- $s3: 	powerUp
#	- $s4:	spawn_time_for coin
#	- $s5:	index of enemy shot
########################################################################
Restart:

	li	$t0, 50
	sw	$t0, xPos
	sw	$t0, yPos
	
	la	$t0, start_screen		#load address of tree
	li 	$t2, 8192			#number of pixels to colour in 
	li	$t3, 0				#current index 

draw_start:
	sll	$t4, $t3, 2			#current index
	
	add	$t5, $t4, BASE_ADDRESS		#current display index
	add	$t6, $t4, $t0  			#current pixel colour
	
	lw 	$t7, 0($t6)
	sw	$t7, 0($t5)
	
	addi	$t2, $t2, -1			#subtract the number of pixels to colour
	addi	$t3, $t2, 1			#increment index
	
	bnez	$t2, draw_start

	
	li	$v1, 0
	li	$t0, 21172
	jal	drawSelect
start_loop:

	li	$v0, 32
	li	$a0, 16
	syscall
	
	input:
		li 	$t9, 0xffff0000
		lw	$t8, 0($t9)
		beq	$t8, 1, check_select
		
		j	start_loop
	check_select:
		lw	$t8, 4($t9)
	
		beq	$t8, 32, enter_selection	#checks for spacebar
		beq	$t8, 97, play			#checks for the press of a
		beq	$t8, 100, quit			#checks for the press of d
		
		j	start_loop


play:
	li	$t0, 21172
	jal	drawSelect
	
	li	$t0 , 21316
	jal	removeSelect
	
	li	$v1, 0
	
	j 	start_loop


quit:
	li	$t0, 21316
	jal	drawSelect
	
	li	$t0 , 21172
	jal	removeSelect
	
	li	$v1, 1
	
	j	start_loop


drawSelect:
	li	$t1, 0		# index  
	li	$t2, 0 
	li	$t4, 1		# skip line 
	
	
	select_loop:
		beq	$t4, 6, select_skip_line
		
		lw	$t3, select($t1)
		sw	$t3, BASE_ADDRESS($t0)
		
		addi	$t4, $t4, 1	#counts pixels until next jump
		addi	$t0, $t0, 4	#increment to the next pixel on the bitmap
		addi	$t1, $t1, 4	#increment to the next colour 
		addi	$t2, $t2, 1	#increment the number of pixels currently coloured 
			
		bne	$t2, 25, select_loop
		
		jr	$ra
		
	select_skip_line:
		li	$t4, 1
		addi	$t0, $t0, 492
		j 	select_loop
	
	
removeSelect:
	
	li	$t2, 0 
	li	$t3, BLUE
	li	$t4, 1		#skip line 
	
	
	remove_loop:
		beq	$t4, 6, remove_skip_line
		sw	$t3, BASE_ADDRESS($t0)
		
		addi	$t4, $t4, 1	#counts pixels until next jump
		addi	$t0, $t0, 4	#increment to the next pixel on the bitmap
		addi	$t2, $t2, 1	#increment the number of pixels currently coloured 
			
		bne	$t2, 25, remove_loop
		
		jr	$ra
		
	remove_skip_line:
		li	$t4, 1
		addi	$t0, $t0, 492
		j 	remove_loop
		
enter_selection:
	beq	$v1, 0, setUp
	beq	$v1, 1, End
	j	start_loop

setUp:
	li	$s0, 0
	li	$s1, 0
	li	$s2, 0
	li	$s4, 0 
	
	jal	initial_enemy
	
	li	$t0, MAX_HEALTH
	
	sw	$t0, heart_struct
	sw	$t0, enemy_struct 
	
	li	$t0, 0
	 
	sw	$t0, heart_struct+4
	sw	$t0, enemy_struct+4
	sw	$t0, items_struct
	sw	$t0, items_struct+4
	
	jal	get_star_position
	
	la	$t0, background		#load address of tree
	li 	$t2, 8192		#number of pixels to colour in 
	li	$t3, 0			#current index 

colour_background:	
	sll	$t4, $t3, 2		#current index
	
	add	$t5, $t4, BASE_ADDRESS	#current display index
	add	$t6, $t4, $t0  		#current pixel colour
	
	lw 	$t7, 0($t6)
	sw	$t7, 0($t5)
	
	addi	$t2, $t2, -1			#subtract the number of pixels to colour
	addi	$t3, $t2, 1			#increment index
	
	bnez	$t2, colour_background
	
########################################################################
# FUNCTION INFORMATION:
# 	Main function that handles the game loop
########################################################################


loop:	

	addi	$s4, $s4, 1

	lw	$t0, spawn_shots+12($s5)
	beq	$t0, 0, no_enemy_shot
	
	remu	$t0, $s4, 2					#UPDATE SPEED OF BULLETS: 
	bne	$t0, 1, no_enemy_shot
	
	jal	drawEnemyShot
	
	no_enemy_shot:
	jal	EnemyHit
	
	skip_enemy_shot:
	lw	$t0, items_struct				# checks conditions for fire coin
	beq	$t0, 1, skip_coin_render			# powerUp enabled:1, powerUp disabled: 0
	blt	$s4, 100, skip_coin_render
	
	jal	drawCoin
	
	skip_coin_render:
	
	lw	$t0, items_struct+4				# checks condition for life orb 
	beq	$t0, 1, skip_life_render
	blt	$s4, 100, skip_life_render
	
	jal	drawLife
	
	skip_life_render:
		jal	drawNinja
		jal	feet_position
		
	
	jal	get_hit
	
	lw	$t1, heart_struct
	beqz	$t1, LOSE
	
	li	$a0, 520
	li	$a1, 0
	jal	drawHeart
	
	lw	$t0, heart_struct+4
	beqz	$t0, playerMissing_hearts
	
	li	$a1, 0
	jal	clear_heart
	
	playerMissing_hearts:

	lw	$t1, enemy_struct
	beqz	$t1, WIN	
	
	li	$a0, 900
	li	$a1, 0 
	jal	enemy_drawHeart
	
	lw	$t0, enemy_struct+4
	beqz	$t0, enemyMissing_hearts
	
	li	$a1, 0
	jal	enemy_clear_heart
	
	enemyMissing_hearts:
	

	li	$v0, 32
	li	$a0, 16
	syscall

	lw	$t0, items_struct	
	beq	$t0, 0, skip_shot
	beq	$s2, 0, skip_shot
	j	shoot

	
	skip_shot:
	
	li	$v0, 32
	li	$a0, 16
	syscall
	
	
	lw	$t0, floor
	beq	$t0, GRASS, readInput
	beq	$t0, BRANCH, readInput
	j	gravity
	
readInput:
	li 	$t9, 0xffff0000
	lw	$t8, 0($t9)
	beq	$t8, 1, keyPress
	
	j 	loop

keyPress:
	lw	$t8, 4($t9)
	
	beq	$t8, 119, jump		#checks for the press of w
	beq	$t8, 32, initial_shot	#checks for spacebar
	beq	$t8, 97, moveLeft	#checks for the press of a
	beq	$t8, 100, moveRight	#checks for the press of d
	
	beq	$t8, 112, Restart
	
	j	loop



########################################################################
# FUNCTION INFORMATION:
# 	These set of move functions will update the players current 
#	position depending on the keyboard input.
########################################################################	
moveRight:
	jal	right_clear
	
	lw	$t1, xPos
	beq	$t1, 110, loop
	
	
	addi	$t1, $t1, 1
	sw	$t1, xPos
	li	$s0, 0 
	
	j loop
	
moveLeft:
	jal 	left_clear 
	
	lw	$t1, xPos
	beq	$t1, 5, loop
	
	addi	$t1, $t1, -1
	sw	$t1, xPos
	li	$s0, 1
	
	j 	loop

moveUp:	
	move	$t8, $ra
	
	jal	up_clear
	
	lw	$t1, yPos
	addi	$t1, $t1, -1
	sw	$t1, yPos


	jr	$t8
	
moveDown:
	move	$t8, $ra
	
	jal 	down_clear
	
	lw	$t1, yPos
	addi	$t1, $t1, 1
	sw	$t1, yPos

	jr	$t8


########################################################################
# FUNCTION INFORMATION:
# 	These set of functions handle the player shooting 
########################################################################
initial_shot:
	lw	$t0, items_struct
	
	beq	$t0, 0, loop
	beq	$s0, 1, loop
	beq	$s2, 1, loop
	jal	get_star_position
	j	shoot
	
shoot:
	jal    	clear_star
	
	lw	$t1, starPos
	addi	$t1, $t1, 4
	sw	$t1, starPos
	
	li	$s2, 1

	jal	drawStar
	

	j readInput


drawStar:
	lw	$t0, starPos
	li	$t1, 0		#index  
	li	$t2, 0 
	li	$t4, 1		#skip line 
	
	star_loop:
		beq	$t4, 4, star_skip_line
		
		lw	$t3, fire_ball($t1)
		
		andi	$t7, $t3, 0xFF000000
		beqz	$t7, star_next

		sw	$t3, BASE_ADDRESS($t0)
		
	star_next:
		
		addi	$t4, $t4, 1	#counts pixels until next jump
		addi	$t0, $t0, 4	#increment to the next pixel on the bitmap
		addi	$t1, $t1, 4	#increment to the next colour 
		addi	$t2, $t2, 1	#increment the number of pixels currently coloured 
			
		bne	$t2, 9, star_loop
		
		jr	$ra
		
	star_skip_line:
		li	$t4, 1
		addi	$t0, $t0, 500
		j 	star_loop

clear_star:
	lw	$t2, starPos
	la	$t0, background	
	add	$t0, $t0, $t2	
	
	add	$t1, $t2, $zero		#address in display
	li	$t2, 0 			#count
	li	$t3, 0			#index 
	
	star_fill:
		lw	$t4, star_offset($t3)
		
		add	$t0, $t0, $t4
		add	$t1, $t1, $t4
		
		lw	$t5, 0($t0)
		sw	$t5, BASE_ADDRESS($t1)
	
		addi	$t2, $t2, 1
		addi 	$t3, $t3, 4
		bne	$t2, 3, star_fill

	jr	$ra
	
get_star_position:
	move	$t7, $ra
	jal	getPosition
	
	addi	$t0, $v1, 2600
	
	sw	$t0, starPos
	
	jr	$t7
	
	
get_hit:
	move 	$t9, $ra

	
	lw	$s7, starPos
	la	$t1, background
	
	add	$s7, $t1, $s7		#location of pixel at star position
	
	lw	$t2, 0($s7)
	
	beq	$t2, BUILDING, confirm_hit
	beq	$t2, BLACK,confirm_hit
	
	j	exit_hit
	
	confirm_hit:
	
		lw	$t1, enemy_struct
		addi	$t1, $t1, -1
		sw	$t1, enemy_struct 
		
		lw	$t1, enemy_struct+4
		addi	$t1, $t1, 1
		sw	$t1, enemy_struct+4
		
		
		li	$s2, 0			#turn off update for ninja star throw
		
		jal	clear_star
		
		lw	$t1, starPos
		addi	$t1, $t1, 4
		sw	$t1, starPos
		
		jal	clear_star
		
		lw	$t1, starPos
		addi	$t1, $t1, 4
		sw	$t1, starPos
		
		jal	clear_star
		
		
		jal	get_star_position
		
	exit_hit:
		jr	$t9
########################################################################
# FUNCTION INFORMATION:
# 	handles enemy shot
########################################################################	

drawEnemyShot:
	move	$t8, $ra
	move	$a0, $s5
	jal	RenderShot
	
	jal	clear_enemy
	
	lw	$t0, spawn_shots($s5)
	addi	$t0, $t0, -4 
	sw	$t0, spawn_shots($s5) 
	
	jr	$t8
	
initial_enemy:

	li	$v0, 42
	li	$a0, 0 
	li	$a1, 3
	syscall
	
	move	$s5, $a0
	
	mul	$s5, $s5, 4
	lw	$v1, spawn_shots($s5)

	li	$t0, 1
	sw	$t0, spawn_shots+12($s5)
	
	jr	$ra

	
	
RenderShot:
	lw	$t0, spawn_shots($s5)
	li	$t1, 0		#index  
	li	$t2, 0 
	li	$t4, 1		#skip line 
	
	render_loop:
		beq	$t4, 4, render_skip_line
		
		lw	$t3, enemy_ball($t1)
		sw	$t3, BASE_ADDRESS($t0)
		
		addi	$t4, $t4, 1	#counts pixels until next jump
		addi	$t0, $t0, 4	#increment to the next pixel on the bitmap
		addi	$t1, $t1, 4	#increment to the next colour 
		addi	$t2, $t2, 1	#increment the number of pixels currently coloured 
			
		bne	$t2, 9, render_loop
		
		jr	$ra
		
	render_skip_line:
		li	$t4, 1
		addi	$t0, $t0, 500
		j 	render_loop
		
	jr	$ra


clear_enemy:
	lw	$t2, spawn_shots($s5)
	la	$t0, background	
	add	$t0, $t0, $t2	
	
	move	$t1, $t2,		#address in display
	li	$t2, 0 			#count
	li	$t3, 0			#index 
	
	enemy_fill:
		lw	$t4, enemy_offset($t3)
		
		add	$t0, $t0, $t4
		add	$t1, $t1, $t4
		
		lw	$t5, 0($t0)
		sw	$t5, BASE_ADDRESS($t1)
	
		addi	$t2, $t2, 1
		addi 	$t3, $t3, 4
		bne	$t2, 3, enemy_fill

	jr	$ra



EnemyHit:
	move	$t9, $ra
	lw	$t0, spawn_shots($s5)
	lw	$t3, BASE_ADDRESS($t0)
	
	beq	$t3, TREE, confirm_enemyHit
	beq	$t3, BODY, confirm_enemyHit
	beq	$t3, ALT_BODY, confirm_enemyHit
	j	skip_enemyHit
	
	confirm_enemyHit:
		beq	$t3, BODY, continueUpdate
		beq	$t3, ALT_BODY, continueUpdate
		
		lw	$t1, heart_struct
		addi	$t1, $t1, -1
		sw	$t1, heart_struct 
		
		lw	$t1, heart_struct+4
		addi	$t1, $t1, 1
		sw	$t1, heart_struct+4
		
		
		continueUpdate:
		jal	clear_enemy
		
		lw	$t1, spawn_shots($s5)
		addi	$t1, $t1, -4
		sw	$t1, spawn_shots($s5)
		
		jal	clear_enemy
		
		lw	$t1, spawn_shots($s5)
		addi	$t1, $t1, -4
		sw	$t1, spawn_shots($s5)
		
		jal	clear_enemy
		
		li	$t2, 0 				# setting the bullet to not in motion
		sw	$t2, spawn_shots+12($s5)	
		
		lw	$t2, initial_shots($s5)
		sw	$t2, spawn_shots($s5)
		
		jal	initial_enemy
		
		
	skip_enemyHit:
	
	jr	$t9
		
	



########################################################################
# FUNCTION INFORMATION:
# 	These set of functions will render the players previous position 
#	with pixels of the background
########################################################################	

up_clear:
	move 	$t9, $ra
	jal	getPosition 
	
	
	la	$t0, background		
	add	$t0, $t0, $v1		#address of background 
	add	$t1, $v1, $zero		#address in display
	li	$t2, 0 			#count
	li	$t3, 0			#index 
	
	up_loop:
		lw	$t4, up_offset($t3)
		
		add	$t0, $t0, $t4
		add	$t1, $t1, $t4
		
		lw	$t5, 0($t0)
		sw	$t5, BASE_ADDRESS($t1)
	
		addi	$t2, $t2, 1
		addi 	$t3, $t3, 4
		bne	$t2, 22, up_loop
	
	jr 	$t9 



down_clear:
	move 	$t9, $ra
	jal	getPosition 
	la	$t0, background	
	
	add	$t0, $t0, $v1		#address of background 
	add	$t1, $v1, $zero		#address in display
	li	$t2, 0 			#count
	li	$t3, 0			#index 
		
	beq	$s0, 1, leftFall	
	j	rightFall
	
	leftFall:
		left_fall_loop:
			lw	$t4, left_fall($t3)
		
			add	$t0, $t0, $t4
			add	$t1, $t1, $t4
		
			lw	$t5, 0($t0)
			sw	$t5, BASE_ADDRESS($t1)
	
			addi	$t2, $t2, 1
			addi 	$t3, $t3, 4
			bne	$t2, 14, left_fall_loop
			j end_fall
	rightFall:
		right_fall_loop:
			lw	$t4, right_fall($t3)
		
			add	$t0, $t0, $t4
			add	$t1, $t1, $t4
		
			lw	$t5, 0($t0)
			sw	$t5, BASE_ADDRESS($t1)
	
			addi	$t2, $t2, 1
			addi 	$t3, $t3, 4
			bne	$t2, 13, right_fall_loop
			j  	end_fall
	
	end_fall:
		jr 	$t9 



right_clear:
	move 	$t9, $ra
	jal	getPosition 
	
	la	$t0, background		
	add	$t0, $t0, $v1		#address of background 
	add	$t1, $v1, $zero		#address in display
	li	$t2, 0 			#count
	li	$t3, 0			#index 
	
	right_loop:
		lw	$t4, right_offset($t3)
		
		add	$t0, $t0, $t4
		add	$t1, $t1, $t4
		
		lw	$t5, 0($t0)
		sw	$t5, BASE_ADDRESS($t1)
	
		addi	$t2, $t2, 1
		addi 	$t3, $t3, 4
		bne	$t2, 17, right_loop
	
	jr 	$t9 
	
left_clear:
	move 	$t9, $ra
	jal	getPosition 
	
	la	$t0, background		
	add	$t0, $t0, $v1		#address of background 
	add	$t1, $v1, $zero		#address in display
	li	$t2, 0 			#count
	li	$t3, 0			#index 
	
	left_loop:
		lw	$t4, left_offset($t3)
		
		add	$t0, $t0, $t4
		add	$t1, $t1, $t4
		
		lw	$t5, 0($t0)
		
		li	$t6, WHITE
		sw	$t5, BASE_ADDRESS($t1)
	
		addi	$t2, $t2, 1
		addi 	$t3, $t3, 4
		bne	$t2, 17, left_loop
	
	jr 	$t9 

########################################################################
# FUNCTION INFORMATION:
# 	This function handles gravity 
########################################################################

jump:
	jal	feet_position
	li	$s6, 0 
	
	lw	$t0, floor
	beq	$t0, GRASS, grass_height
	beq	$t0, BRANCH, branch_height
	
	j 	skip_jump
	grass_height:
		li	$a2, 38
		j	continue_jump
	branch_height:
		li	$a2, 15
		j	continue_jump
	
	continue_jump:
		jal	moveUp
		jal	drawNinja
		jal	air_strafe
		
		jal	drawEnemyShot
		jal	EnemyHit
		
		beq	$s2, 0, skip_jump_shot
		
		jal	clear_star
		
		lw	$t1, starPos
		addi	$t1, $t1, 4
		sw	$t1, starPos
		
		jal	drawStar
		jal	get_hit
		
		skip_jump_shot:
		li	$v0, 32
		li	$a0, 10
		syscall
		
		addi	$s6, $s6, 1
		bne	$s6, $a2, continue_jump	
		
	skip_jump:
		j 	gravity
	
gravity:
	jal	moveDown
	j 	loop
	

air_strafe:
	move	$t7, $ra
	
	li 	$t9, 0xffff0000
	lw	$t8, 0($t9)
		
	bne	$t8, 1, strafe_exit
	lw	$t8, 4($t9)
	
	beq	$t8, 97, strafe_left	#checks for the press of a
	beq	$t8, 100, strafe_right	#checks for the press of d	
	
	j	strafe_exit
	
	strafe_left:
		jal 	moveLeft
		j	strafe_exit
	
	strafe_right:
		jal	moveRight
		j	strafe_exit
	
	strafe_exit:
		jr $t7

	
									

