	jal	check_life

	jr	$t8																		
########################################################################
# FUNCTION INFORMATION:
#	This function draws the hearts on the screen 
########################################################################
drawHeart:
	move	$t0, $a0
	li	$t1, 0		#index  
	li	$t2, 0 
	li	$t4, 1		#skip line 
	
	heart_loop:
		beq	$t4, 8, heart_skip_line
		
		lw	$t3, heart($t1)
		
		andi	$t7, $t3, 0xFF000000
		beqz	$t7, heart_next

		sw	$t3, BASE_ADDRESS($t0)
		
	heart_next:
		
		addi	$t4, $t4, 1		#counts pixels until next jump
		addi	$t0, $t0, 4		#increment to the next pixel on the bitmap
		addi	$t1, $t1, 4		#increment to the next colour 
		addi	$t2, $t2, 1		#increment the number of pixels currently coloured 
			
		bne	$t2, 49, heart_loop
		
		addi	$a1, $a1, 1		# keeps record of how many hearts
		addi	$a0, $a0, 32
		
		lw	$t1, heart_struct
		bne	$a1, $t1, drawHeart
		
		jr	$ra
		
	heart_skip_line:
		li	$t4, 1
		addi	$t0, $t0, 484
		j 	heart_loop


clear_heart:
	move	$t0, $a0
	li	$t1, 0		#index  
	li	$t2, 0 
	li	$t4, 1		#skip line 
	
	clear_heart_loop:
		beq	$t4, 8, clear_heart_skip_line
		
		lw	$t3, broken_heart($t1)

		andi	$t7, $t3, 0xFF000000
		beqz	$t7, clear_heart_next

		sw	$t3, BASE_ADDRESS($t0)
		
	clear_heart_next:
		
		addi	$t4, $t4, 1	#counts pixels until next jump
		addi	$t0, $t0, 4	#increment to the next pixel on the bitmap
		addi	$t1, $t1, 4	#increment to the next colour 
		addi	$t2, $t2, 1	#increment the number of pixels currently coloured 
		
		bne	$t2, 49, clear_heart_loop

		addi	$a1, $a1, 1		# keeps record of how many hearts
		addi	$a0, $a0, 32
		
		lw	$t1, heart_struct+4
		bne	$a1, $t1, clear_heart
		
		jr	$ra
		
	clear_heart_skip_line:
		li	$t4, 1
		addi	$t0, $t0, 484
		j 	clear_heart_loop




