########################################################################
# FUNCTION INFORMATION:
# 	This function draws the player depending on the top left position 
#	of the player.
########################################################################	

drawNinja:	
	move	$t9, $ra
	jal 	getPosition
	
	move 	$t0, $v1
	
	add	$t0, $t0, BASE_ADDRESS		#player position
	li	$t1, 99			#number of pixels to colour in 
	li	$t2, 0			#index of colours
	
	
	j	load_spirite
	
	drawContinue:
		li 	$t3, 0			#index of display
		li 	$t4, 0			#jump to next line
	
		drawLoop:		
			sll	$t5, $t3, 2		#offset
			add	$t6, $t5, $t0		#current position
	
			sll	$t5, $t2, 2
			add	$t7, $t5, $s1
	
			lw	$t8, 0($t7)
	
			andi	$t7, $t8, 0xFF000000
			beqz	$t7, next
	
			sw	$t8, 0($t6)
	
		next:	
	
			addi	$t4, $t4, 1
			addi	$t3, $t3, 1
			addi	$t1, $t1, -1
			addi	$t2, $t2, 1
	
			beq	$t4, 10, goNext 
			bnez	$t1, drawLoop
			jr 	$t9
	
		goNext:	
			addi	$t3, $t3, 118
			li	$t4, 0
			
			j drawLoop
	load_spirite:
	
		beq	$s0, 0, right_spirite
		beq	$s0, 1, left_spirite
		
		right_spirite:
			lw	$t3, items_struct
			beq	$t3, 1, powerUp_right
			la 	$s1, ninja_right	#address of array
			j 	drawContinue
		left_spirite:
			lw	$t3, items_struct
			beq	$t3, 1, powerUp_left
			la 	$s1, ninja_left		#address of array
			j 	drawContinue

		powerUp_left:
			la	$s1, power_left
			j 	drawContinue
		powerUp_right:
			la	$s1, power_right
			j 	drawContinue
																																																																													
########################################################################
# FUNCTION INFORMATION:
# 	these functions handle the logic with grabbing coin power ups
########################################################################	

check_coin:
	la	$t0, BASE_ADDRESS
	addi	$t0, $t0, 13536
	
	beq	$t0, $v1, grab_coin
	j 	no_coin
	
	grab_coin:
		li	$t0, 1
		sw	$t0, items_struct
		j 	no_coin
	no_coin:
		jr	$ra

drawCoin:
	move	$t9, $ra
	
	li	$t0, 12508	#Address on Display
	li 	$t1, 0		#index 
	li	$t2, 1		#count
	li	$t4, 0		#jump
	
	coin_loop:
		beq	$t4, 4, coin_skip_line
		lw	$t3, fire_coin($t1)
		sw	$t3, BASE_ADDRESS($t0)
		
		addi	$t4, $t4, 1
		addi	$t0, $t0, 4
		addi	$t1, $t1, 4
		addi	$t2, $t2, 1
			
		bne	$t2, 17, coin_loop
		
		jal	body_position
		jr	$t9
		
	coin_skip_line:
		li	$t4, 0
		addi	$t0, $t0, 496
		j coin_loop
	


check_life:
	la	$t0, BASE_ADDRESS
	addi	$t0, $t0, 19520
	
	beq	$t0, $v1, grab_life
	j 	no_life
	
	grab_life:
		li	$t0, 1
		sw	$t0, items_struct+4
		
		li	$t0, MAX_HEALTH
		sw	$t0, heart_struct
		
		li	$t0, 0 
		sw	$t0, heart_struct+4
		
		j 	no_life
	no_life:
		jr	$ra
	

drawLife:
	move	$t9, $ra
	
	li	$t0, 18492	#Address on Display
	li 	$t1, 0		#index 
	li	$t2, 1		#count
	li	$t4, 0		#jump
	
	life_loop:
		beq	$t4, 4, life_skip_line
		lw	$t3, life_orb($t1)
		sw	$t3, BASE_ADDRESS($t0)
		
		addi	$t4, $t4, 1
		addi	$t0, $t0, 4
		addi	$t1, $t1, 4
		addi	$t2, $t2, 1
			
		bne	$t2, 17, life_loop
		
		jal	body_position
		jr	$t9
		
	life_skip_line:
		li	$t4, 0
		addi	$t0, $t0, 496
		j life_loop

########################################################################
# FUNCTION INFORMATION:
# 	This function calculates the position of the player depending on 
#	the current x and y position 
########################################################################
			
getPosition:
	lw 	$t0, xPos
	lw	$t1, yPos
	
	mul 	$t1, $t1, 128		# y*128
	add	$t1, $t1, $t0		# y*128 + x
	
	mul 	$v1, $t1, 4		# 4*(y*128 + x)
	
	jr 	$ra

	
########################################################################
# FUNCTION INFORMATION:
# 	This function handles rendering the win and lose screen 
########################################################################	
LOSE:
	la	$t0, lose_screen		#load address of tree
	li 	$t2, 8192			#number of pixels to colour in 
	li	$t3, 0				#current index 

lose_start:
	sll	$t4, $t3, 2			#current index
	
	add	$t5, $t4, BASE_ADDRESS		#current display index
	add	$t6, $t4, $t0  			#current pixel colour
	
	lw 	$t7, 0($t6)
	sw	$t7, 0($t5)
	
	addi	$t2, $t2, -1			#subtract the number of pixels to colour
	addi	$t3, $t2, 1			#increment index
	
	bnez	$t2, lose_start
	j 	End

WIN:
	la	$t0, win_screen			#load address of tree
	li 	$t2, 8192			#number of pixels to colour in 
	li	$t3, 0				#current index 

win_start:
	sll	$t4, $t3, 2			#current index
	
	add	$t5, $t4, BASE_ADDRESS		#current display index
	add	$t6, $t4, $t0  			#current pixel colour
	
	lw 	$t7, 0($t6)
	sw	$t7, 0($t5)
	
	addi	$t2, $t2, -1			#subtract the number of pixels to colour
	addi	$t3, $t2, 1			#increment index
	
	bnez	$t2, win_start
	j 	End
End:
	li 	$v0, 10
	syscall
